(154, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:59:\"Elementors CEO Talks Fundraising: Why, And Whats Next\";s:7:\"excerpt\";s:182:\"Learn more about Elementors $15M institutional funding round led by Lightspeed Venture Partners, and what it means for the website building industry and Elementors community.\r\n\";s:7:\"created\";s:10:\"1582734340\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/elementor-funding/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:59:\"The Community Has Spoken  Announcing the Winning Feature\";s:7:\"excerpt\";s:132:\"As part of our 4 million active installs celebration, we invited you to vote for the next Elementor feature. Here are the results.\r\n\";s:7:\"created\";s:10:\"1581508800\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:125:\"https://elementor.com/blog/4-million-winning-feature/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:70:\"Introducing Theme Style: Customize Your WordPress Theme With Elementor\";s:7:\"excerpt\";s:155:\"Get ready, The first stage of global styling is here! Elementor Version 2.9 brings a new way to set global headings, backgrounds, images, buttons and more.\";s:7:\"created\";s:10:\"1581433898\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:123:\"https://elementor.com/blog/introducing-theme-style/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:67:\"Celebrating 4 Million Active Installs  Vote for the Next Feature\";s:7:\"excerpt\";s:158:\"We are thrilled to announce today 4 million active installs! To celebrate this milestone, we invite you to vote for the next Elementor feature to be released!\";s:7:\"created\";s:10:\"1580318942\";s:5:\"badge\";s:9:\"Milestone\";s:3:\"url\";s:125:\"https://elementor.com/blog/4-million-active-installs/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:64:\"Monday Masterclass: How to Design Navigation Menus for WordPress\";s:7:\"excerpt\";s:276:\"This week were looking at how at navigation menus and what makes them so critical to user experience and SEO ranking. We also review the 5 primary styles of menu design on WordPress websites, and examine the important dos & donts to consider when designing nav-menus.\";s:7:\"created\";s:10:\"1579522814\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:107:\"https://elementor.com/blog/?p=35653&utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
