(5, 1, '2020-03-04 07:27:08', '2020-03-04 07:27:08', '{\"id\":5,\"field_id\":5,\"fields\":{\"0\":{\"id\":\"0\",\"type\":\"name\",\"label\":\"Your Name \",\"format\":\"simple\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"simple_placeholder\":\"\",\"simple_default\":\"\",\"first_placeholder\":\"\",\"first_default\":\"\",\"middle_placeholder\":\"\",\"middle_default\":\"\",\"last_placeholder\":\"\",\"last_default\":\"\",\"css\":\"\"},\"1\":{\"id\":\"1\",\"type\":\"email\",\"label\":\"Email\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"\",\"confirmation_placeholder\":\"\",\"default_value\":\"\",\"css\":\"\"},\"4\":{\"id\":\"4\",\"type\":\"text\",\"label\":\"Subject\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"\",\"default_value\":\"\",\"css\":\"\",\"input_mask\":\"\"},\"2\":{\"id\":\"2\",\"type\":\"textarea\",\"label\":\"Your Message\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"\",\"css\":\"\"}},\"settings\":{\"form_title\":\"Contact Form 1\",\"form_desc\":\"\",\"form_class\":\"\",\"submit_text\":\"SEND MESSAGE\",\"submit_text_processing\":\"Sending...\",\"submit_class\":\"\",\"honeypot\":\"1\",\"notification_enable\":\"1\",\"notifications\":{\"1\":{\"email\":\"email@example.com\",\"subject\":\"New Entry: Contact Form 1\",\"sender_name\":\"{field_id=\\\"0\\\"}\",\"sender_address\":\"{admin_email}\",\"replyto\":\"{field_id=\\\"1\\\"}\",\"message\":\"{all_fields}\"}},\"confirmations\":{\"1\":{\"type\":\"message\",\"message\":\"<p>Thanks for contacting us! We will be in touch with you shortly.<\\/p>\",\"message_scroll\":\"1\",\"page\":\"7\",\"redirect\":\"\"}}},\"meta\":{\"template\":\"contact\"}}', 'Contact Form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2020-03-04 07:27:09', '2020-03-04 07:27:09', '', 0, 'http://localhost/wordpress/?post_type=wpforms&#038;p=5', 0, 'wpforms', '', 0),
