(509, 1, '2020-03-04 21:04:44', '2020-03-04 21:04:44', '<h1>Let\'s <br>PLAY. GROW. LEARN.</h1>		\n			<h3>together!</h3>		\n			<h3>FASC offers an engaging learning experince for children ages 3 to 5 years old</h3>		\n			<h5>How to enroll</h5>		\n			<p>Online registration to reserve your child\'s place today.</p>		\n			<center>\n<i>\n</i>\n</center>		\n			<a href=\"#\" role=\"button\">\n						learn more\n					</a>\n			<h5>Programs offered</h5>		\n			<p>Know the requirements and procedure of enrollment</p>		\n			<center>\n<i>\n</i>\n</center>		\n			<a href=\"#\" role=\"button\">\n						Learn more\n					</a>\n			<h5>Take a tour</h5>		\n			<p>Take a virtual tour of our school</p>		\n			<center>\n<i>\n</i>\n</center>		\n			<a href=\"#\" role=\"button\">\n						Learn more\n					</a>\n										<img width=\"768\" height=\"768\" src=\"http://localhost/wordpress/wp-content/uploads/2020/03/school-741165-768x768.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/03/school-741165-768x768.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/03/school-741165-300x300.jpg 300w, http://localhost/wordpress/wp-content/uploads/2020/03/school-741165-1024x1024.jpg 1024w, http://localhost/wordpress/wp-content/uploads/2020/03/school-741165-150x150.jpg 150w, http://localhost/wordpress/wp-content/uploads/2020/03/school-741165-1536x1536.jpg 1536w, http://localhost/wordpress/wp-content/uploads/2020/03/school-741165-2048x2048.jpg 2048w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n			<h2>Small Class Size</h2>		\n			<p>FASC Strives to provide exceptional care and education in a safe and nurturing environment. Our low student to teacher ratio allows our teachers to spend more time working onon one with our students and better meeting the needs of each child.</p>		\n			<h2>Licensed Teachers</h2>		\n			<p>FASC believes it is important to seek out the most compassionate and qualified staff to care for your child. All teachers at FASC have earned at least a B.S. in Early Education, Child Development, Elementary Education, or a related field.</p>		\n										<img width=\"768\" height=\"507\" src=\"http://localhost/wordpress/wp-content/uploads/2020/03/school-1782427-768x507.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/03/school-1782427-768x507.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/03/school-1782427-300x198.jpg 300w, http://localhost/wordpress/wp-content/uploads/2020/03/school-1782427-1024x676.jpg 1024w, http://localhost/wordpress/wp-content/uploads/2020/03/school-1782427-1536x1014.jpg 1536w, http://localhost/wordpress/wp-content/uploads/2020/03/school-1782427-2048x1352.jpg 2048w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n			<h2>FACILITIES FEATURED</h2>		\n				<figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/classroom-510228-scaled.jpg\" alt=\"Class room\" /></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/computer-901857-scaled.jpg\" alt=\"reading room\" /></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/airport-742841-scaled.jpg\" alt=\"waiting room\" /></figure><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2020/03/library-1220866-scaled.jpg\" alt=\"Play Room\" /></figure>			\n						Previous\n						Next\n			<h2>Interested in learning more about our program? </h2>		\n			<h3>Visit us</h3>		\n			<center>\n<i>\n</i>\n</center>		\n			<h3>Message Us</h3>		\n			<center>\n<i>\n</i>\n</center>		\n			<a href=\"#\" role=\"button\">\n						See map \n					</a>\n			<a href=\"#\" role=\"button\">\n						Contact us\n					</a>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2020-03-05 06:23:10', '2020-03-05 06:23:10', '', 0, 'http://localhost/wordpress/?page_id=509', 0, 'page', '', 0),
